import React from "react";
import "./FooterAnimation.css";
import "./Footer.css";

function Footer() {
  return (
    <div className="footer-container">
      <div className="footer-sub-container">
      <div
        className="wave wave1"
        style={{ backgroundImage: "url(/img/wave.png)" }}
      ></div>
      <div className="footer-bottom-container">
        <div className="footer-left-container">
          <div className="footer-left-container-p">
            <p>
              Pelin kozmetik uzun yıllar deneyimleri sonucu üretim tesislerinde
              kendi markaları için üretim yapmak isteyen zincir mağazaları için
              onların markası ile fason kozmetik üretimi ve kozmetik fason dolum
              hizmetleri vermektedir.
            </p>
          </div>
        </div>
      </div>
    </div>
    </div>
  );
}

export default Footer;

